import './App.css';
import Users from './Users.js';
import Excelupload from './Excelupload.js';

function App() {
  return (
    <div>
    <table class="table">
    <tr>
    <td><h2>AttendanceSYS </h2></td>
    <td align="right">
    <Excelupload/>
    </td>
    </tr>
    </table>

    <Users/>
    </div>
  );
}

export default App;
